INSERT INTO `ecs_article` ( `article_id`, `cat_id`, `title`, `content`, `author`, `author_email`, `keywords`, `article_type`, `is_open`, `add_time`, `file_url`, `open_type`, `link`, `description` ) VALUES  ('14', '6', 'Â∫∑Áæé‰ªãÁªç', '<strong><span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:21px;\"> \r\n<p style=\"text-align:center;background-color:#ffffff;text-indent:43px;color:#3e3e3e;\">\r\n	<strong><span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:21px;\">Âåó‰∫¨Â∫∑ÁæéÁõäÂØøÂåªÁñóÁßëÊäÄÊúâÈôêÂÖ¨Âè∏ÂÖ¨Âè∏ÁÆÄ‰ª\ã</span></strong>\r\n</p>\r\n<p style=\"text-align:center;background-color:#ffffff;text-indent:37px;color:#3e3e3e;\">\r\n	<span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:19px;\"><img alt=\"\" src=\"http://mmbiz.qpic.cn/mmbiz/ubIxVbxh3Ne2Rhhe2WeE7hbAgVHuGu6ZVt7edZlQqZuGVyqJYjcC1qv48eZ8TEqGlnESGSrN9PvHib2Zq6Fiadyw/640?wx_fmt=png&amp;tp=webp&amp;wxfrom=5\" width=\"140\" height=\"140\" /><br />\r\n</span>\r\n</p>\r\n<p style=\"background-color:#ffffff;text-indent:37px;color:#3e3e3e;\">\r\n	<span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:19px;\">Âåó‰∫¨Â∫∑ÁæéÁõäÂØøÂåªÁñóÁßëÊäÄÊúâÈôêÂÖ¨Âè∏ÔºàÁÆÄÁß∞Â∫∑ÁæéÁõäÂØøÔºâÔºåÂàõÂª∫‰∫é1996Âπ\¥1ÊúàÔºåÊòØÊîøÂ∫úÊéà‰∫àÁîü‰∫ßËÆ∏ÂèØ„ÄÅÁªèËê•ËÆ∏ÂèØÁöÑÂåªÁñóÂô®Ê¢∞‰ºÅ‰∏öÔºåÂπ∂‰∏îÂ∑≤ÈÄöËøáÂõΩÂÆ∂ËçØÁõëÂ±ÄËßÑÂÆöÁöÑÂåªÁñóÂô®Ê¢∞Ë¥®ÈáèÁÆ°ÁêÜ‰ΩìÁ≥ªËÆ§ËØÅÔºåÂ§öÁßçÂûãÂè∑‰∫ßÂìÅËé∑Âåó‰∫¨Â∏ÇËçØÁõëÂ±ÄÂåªÁñóÂô®Ê¢∞ÂáÜÂ≠óÂè∑ÊâπÊñá„Ä\Ç</span>\r\n</p>\r\n<p style=\"background-color:#ffffff;text-indent:37px;color:#3e3e3e;\">\r\n	<span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:19px;\">Â∫∑ÁæéÊòØÂõΩÂÜÖÂæÆÁîµËÑë‰∏≠È¢ëÊ≤ªÁñó‰ª™Á†îÂèë„ÄÅÁîü‰∫ßÁöÑÂÖàÈ©±‰ºÅ‰∏ö‰πã‰∏Ä„ÄÇÁîü‰∫ßÂíåÁªèËê•Â§öÁßçÂäüËÉΩÂíåÂûãÂè∑ÁöÑÂæÆÁîµËÑë‰∏≠È¢ëÊ≤ªÁñó‰ª™ÔºåÊã•ÊúâÂõΩÂÜÖÂπøÂ§ßÁöÑÁî®Êà∑Áæ§‰Ωì„Ä\Ç</span>\r\n</p>\r\n<p style=\"background-color:#ffffff;text-indent:0px;color:#3e3e3e;\">\r\n	<span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:19px;\"></span><span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:19px;\">ÂçÅÂá†Âπ¥ÁöÑÂèëÂ±ïÔºåÂ∫∑ÁæéÈáçÂª∫Á†îÂèë„ÄÅÁîü‰∫ßÂíåÈîÄÂîÆ‰ΩìÁ≥ªÔºõÈáçÂª∫ÂåªÁñó„ÄÅÁîµÂ≠ê„ÄÅÁÆ°ÁêÜÁ≠âÂ§ö‰∏ì‰∏öÁöÑ‰∫∫Êâç‰ΩìÁ≥ªÔºõÈáçÂª∫Áé∞‰ª£‰ºÅ‰∏öÂà∂Â∫¶Âíå‰ø°ÊÅØÂåñÁÆ°ÁêÜ‰ΩìÁ≥ªÔºå‰ª•ÊñáÊòé„ÄÅÂÅ•Â∫∑„ÄÅÂÖ≥Áà±ÁöÑÁêÜÂøµÁõ¥Èù¢ÂÅ•Â∫∑‰∫ß‰∏ö„Ä\Ç</span>\r\n</p>\r\n<p style=\"background-color:#ffffff;text-indent:37px;color:#3e3e3e;\">\r\n	<span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:19px;\">Â∫∑Áæé‰ª•È´òË¥®ÈáèÁöÑ‰∫ßÂìÅ„ÄÅÊúÄÂπ≥ÂÆûÁöÑ‰ª∑Ê†º„ÄÅÊúÄ‰æøÊç∑ÁöÑÈîÄÂîÆ„ÄÅÊúÄÂÆà‰ø°ÁöÑÂîÆÂêéÊúçÂä°Ëé∑Âæó‰∏ÄËá¥Â•ΩËØÑ„Ä\Ç</span>\r\n</p>\r\n<p style=\"background-color:#ffffff;text-indent:37px;color:#3e3e3e;\">\r\n	<span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:19px;\">Â∫∑ÁæéÊòØÂøóÂ≠òÈ´òËøú„ÄÅÂÜÖÊïõÂπ≥Âíå„ÄÅÂãá‰∫éËøõÂèñÁöÑ‰ºÅ‰∏öÔºåÂ•πÂ∞Ü‰æùÈù†ÂÖ®ÂëòËá™ËßâÂú∞„ÄÅÊô∫ÊÖßÂú∞„ÄÅ‰∏çÊáàÂú∞Âä™ÂäõÔºå‰πü‰æùÈù†Êñ∞ËÄÅÁî®Êà∑ÁöÑ‰ø°‰ªª„ÄÅÂëµÊä§ÂíåÈºéÂäõÊîØÊåÅ„Ä\Ç</span>\r\n</p>\r\n<p style=\"background-color:#ffffff;text-indent:37px;color:#3e3e3e;\">\r\n	<span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:19px;\">Â∫∑ÁæéÂä±Á≤æÂõæÊ≤ªÔºåÊä´ËçÜÊñ©Ê£òÔºåÈÄêÊâπÂú∞Á†îÂà∂ÂíåÁîü‰∫ßÈ´òÊ∞¥Âπ≥ÁöÑÂ∫∑Â§ç‰ª™Ôºå</span><span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:19px;\">‰∏∫‰∏≠ËÄÅÂπ¥ÊúãÂèãÁöÑÂÅ•Â∫∑Ë¥°ÁåÆÊâçÊô∫ÂíåÂäõÈáè„ÄÇÊàë‰ª¨‰πüÊ¨¢ËøéÂÖ≥ÂøÉÂÅ•Â∫∑ÁöÑ‰∫∫Â£´Êù•ËßÅËØÅÂ∫∑ÁæéÁöÑÊñ∞ÊàêÂ∞±„Ä\Ç</span>\r\n</p>\r\n<p style=\"background-color:#ffffff;text-indent:37px;color:#3e3e3e;\">\r\n	<span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:19px;\">Â∫∑Áæé‰∏∫Áî®Êà∑Âà∂ÈÄ†ÊúÄÂ•ΩÁöÑ‰∫ßÂìÅÔºå‰∏∫Á§æ‰ºöËê•ÈÄ†ÊúÄ‰ΩìË¥¥ÁöÑÂÖ≥Áà±„Ä\Ç</span>\r\n</p>\r\n<p style=\"background-color:#ffffff;text-indent:0px;color:#3e3e3e;\">\r\n	<span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:19px;\">Â∫∑ÁæéÁöÑÊâøËØ∫ÔºöÊâÄÂîÆ‰∫ßÂìÅÂùáÂèóÁêÜÁî®Êà∑ÊäïËØâÔºåÊâÄËÆæÂÖ¨Âè∏Ê≤ªÁêÜÁªìÊûÑÂùáÂÆàÊ≥ïËßÑÂíåÈáçÂÆûÊïàÔºõ</span>\r\n</p>\r\n<p style=\"background-color:#ffffff;text-indent:0px;color:#3e3e3e;\">\r\n	<span style=\"font-style:normal;font-family:ÂÆã‰Ωì;font-size:19px;\">ÂÅöÂà∞ÊâÄÁªèËê•‰∫ßÂìÅÁ°Æ‰øùÂ